name = "cucumber" # this should be the same as the filename of your test target
harness = false # allows Cucumber to print output instead of libtest And simply sleep on each step to test the async support. In the real world you of course will switch it up to web/database requests, etc. # use std::{convert::Infallible, time::Duration};
