async fn main() { AnimalWorld::run("/tests/features/book").await;
} Hm, it looks like the executor waited only for the first Feature ðŸ¤”, what's going on? By default Cucumber executes Scenarios concurrently ! That means executor actually did wait for all the steps, but overlapped! This allows you to execute tests much faster! If for some reason you don't want to run your Scenarios concurrently, use @serial tag on them: Feature: Animal feature @serial Scenario: If we feed a hungry cat it will no longer be hungry Given a hungry cat When I feed the cat Then the cat is not hungry @serial Scenario: If we feed a satiated cat it will not become hungry Given a satiated cat When I feed the cat Then the cat is not hungry

