#[derive(Debug)]
struct AnimalState { pub hungry: bool
} impl AnimalState { fn feed(&mut self) { self.hungry = false; }
} #[derive(Debug, WorldInit)]
pub struct AnimalWorld { cat: AnimalState, dog: AnimalState, ferris: AnimalState,
} #[async_trait(?Send)]
