} #[derive(Clone, Copy)]
enum State { Hungry, Satiated,
} impl FromStr for State { type Err = &'static str; fn from_str(s: &str) -> Result<Self, Self::Err> { match s { "hungry" => Ok(Self::Hungry), "satiated" => Ok(Self::Satiated), _ => Err("expected hungry or satiated"), } }
} #[derive(Clone, Copy, Parameter)]
#[param(regex = "cat|dog|ðŸ¦€")]
enum Animal { Cat, Dog, Ferris,
} impl FromStr for Animal { type Err = &'static str; fn from_str(s: &str) -> Result<Self, Self::Err> { match s { "cat" => Ok(Self::Cat), "dog" => Ok(Self::Dog), "ðŸ¦€" => Ok(Self::Ferris), _ => Err("expected 'cat', 'dog' or 'ðŸ¦€'"), } }
